      <div className="chatbot__header">
        <h2>
          Chatbot {" "}
          <span className="post__headerSpecial">
            <VerifiedUserIcon className="post__badge" />
          </span>
        </h2>
      </div>
      <div className="searchbox">
      <img src="C:\Users\Aditya\Desktop\nullclass_practice\twiller-twitterclone\twiller\src\image\attach.png" alt="Attach" class="icon" />
       <input type="text" placeholder="Ask anything" />
        <img src="send-icon.png" alt="Send" class="send-button" />
     
      </div>
    </div>
  );
};

export default chatbot;
